func (v OBX) ChildVaries(reg func(string) (any, bool)) (reflect.Value, error) {
	vt, ok := reg(v.ValueType)
	if !ok {
		return reflect.Value{}, fmt.Errorf("unknown OBX data type %q", v.ValueType)
	}

	rt := reflect.TypeOf(vt)
	rv := reflect.New(rt)
	return rv.Elem(), nil
}

